import CreateDeckForm from "./CreateDeckForm";
import { useRouteMatch } from "react-router-dom";

function NewDeckView({formData}){

    return (
        <>
          <h2>Deck</h2>
          <ul>
            New Deck View
            {formData.map((currentValue, index) => (
                <li key={index}>
                    <Link to="">
                    {currentValue.name}
                    </Link></li>
            ))}
          </ul>
        </>
      );


}

export default NewDeckView;
